Cheap suspense over: we saw the Northern Lights!! So incredibly grateful and lucky to have crossed off a major bucket list item, Alhamdulillah 🥲

But now for some real talk? I’m about to burst your bubble in three.. two… one…. Northern Lights look nothing like they do on camera in person 🥺🫠 I had been watching photos and videos for years imagining the sky will turn a bright green, but in reality they are a faint greenish gray hue in the sky, which gets picked up a lot more on camera with night vision in them. Of course, this is just based on my experience, but I’ve also done some reading and it sounds like even if you get really lucky with aurora activity, it still won’t look like it does on camera. 

Not to mention they are really really hard to find, even in the best location at the best time, because there are so many factors out of our control such as cloud cover and aurora activity. So you have to prepare yourself to have a few sleepless nights driving around and waiting for hours to spot them. 

Are they worth it?! Hmmmm I am still debating this. I feel like if I had realistic expectations, they would have definitely been worth it. But turns out my expectations were completely unrealistic, so it was a bit disappointing (which is why I’m out here busting myths so you guys are better prepared 😂)

We did have SO much fun in Alaska, though! It was my first time experiencing such low temperatures (-25C on some nights), and it was a really memorable experience. The highlight was definitely the doggos. And the people were so kind. I’d love to go back during the summer 🥰 

